  input: 'TEXT,"F3XA","","Dear Ms. Needles,  We have amended our 10/19/00 to 11/27/00
    report to clarify which office and for which district(if applicable) disbursements
    made to federal candidates.  At the time of this report, computer software problems
    continued to plague us.  As for your other issue raised in your June 20, 2001
    letter, partnerships who had contributed to our PAC were denoted in our report,
    but the software did not put the partner(s) next to the partnership. We have corrected
    how the partnerships are displayed.  The Wiley, Rein and Fielding contribution
    was $500 and attributed between10 partners, the partners did not show up on in
    the report as their contributions were under the threshhold.  For the record,
    the contribution was attributed to the following partners, $50 each; Russell Duncan,
    Nathaniel Emmons, Paul Khoury, Peter Klarfeld, Thomas Queen, James Rubinger, John
    Shane, Jim Slattery, Daniel Standish, and Charles Verrill.  You will notice also
    that our cash on hand is $2500 less.  The reason for this is that 3 partners in
    the various partnership contributions were entered as regular contributions and
    not memo entries.  We have corrected this and for the record they are:  Margaret
    Tishman, Darrell Gay and Joseph Panepinto."'
